"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?33/56/34698?source=related_link\">",
"      Treatment of acute decompensated heart failure: Components of therapy",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?12/38/12905?source=related_link\">",
"      Use of beta blockers in heart failure due to systolic dysfunction",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?18/4/18504?source=related_link\">",
"      Use of digoxin in heart failure due to systolic dysfunction",
"     </a>",
